  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of the Integrated Pest Management
  Plan is to provide a comprehensive, environmentally sensitive approach to managing
  pests on the Lostwood Wetland Management District Complex. The goals and objectives
  of the Integrated Pest Management Plan are 1) to develop and implement strategies
  to prevent invasion and establishment of aggressive non-native plants and non-native
  animal pests on the Refuge, and 2) to control and manage existing invasive, non-native
  populations. This plan targets several invasive plant and animal species that have
  established populations on the Refuge.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
